  eli:CELEX "32018L2001" ;
  eli:ELI <http://data.europa.eu/eli/dir/2018/2001/oj> ;
  dc:description """Specific rules for biofuels, bioliquids and biomass fuels produced from food and feed crops""" .

<http://example.com/EU_32018L2001_Title_0_Chapter_0_Section_0_Article_26#Annotator>
